//#custom code - Start

$(document).ready(function () {
    var userAgent = navigator.userAgent || navigator.vendor || window.opera;
    if (/|iPhone/.test(userAgent) && !window.MSStream && userAgent.indexOf("Phone OS 13_") > 0) {
        $("#_logoHome, #_logoFooter").on("touchstart", function () {
            window.location = $(this).attr("href");
        });

        $(".c-breadcrumbs__item a").on("touchstart", function () {
            window.location = $(this).attr("href");
        });
    }
});

if (window.location.href.indexOf("adcbsecurities.com") >= 0) {
    if (window.location.href.indexOf("/en/") > 0) {
        $("#_logoHome").attr("href", "/en/");
        $("#_logoFooter").attr("href", "/en/");
    } else {
        $("#_logoHome").attr("href", "/ar/");
        $("#_logoFooter").attr("href", "/ar/");
    }
}

if ($("html").attr("lang") == "ar") {
    $(".c-branch-finder__nav-mobile a").click(function () {
        if ($(this).attr("data-viewtype") == "map") {
            $(".c-branch-list .c-branch-container").addClass("hide").removeClass("show");
            $(".c-branch-finder-map").addClass("show").removeClass("hide");
        } else {
            $(".c-branch-list .c-branch-container").addClass("show").removeClass("hide");
            $(".c-branch-finder-map").addClass("hide").removeClass("show");
            setTimeout(function () {
                $(".c-branch-list .c-branch-container").addClass("show").removeClass("hide");
            }, 100);
        }
    });
}

$(".js-toggleSearchBox").click(function () {
    $(".c-search__listwrapper").html("");
    $("#st-search-input-header").val("");
});

//#custom code - End

// video component scripts - by: Hemmat - 20Jan2010
// ---------------------------
// if scroll puase video
if (document.getElementById("video-overlay")) {
    $(document).ready(function () {
        //if ($(window).width() <768 ){
        //var myvid = $('#videotag')[0];
        //$(window).scroll(function(){
        // var scroll = $(this).scrollTop();
        // scroll > 320 ? myvid.pause() : myvid.play()
        //})
        //}

        // if click playbutton play video
        var overlay = document.getElementById("video-overlay");
        var video = document.getElementById("videotag");
        var videoPlaying = false;
        function hideOverlay() {
            overlay.style.display = "none";
            videoPlaying = true;
            video.play();
        }
        overlay.addEventListener("click", hideOverlay);

        // JQUERY - if .-fullwidthonly then add .container
        function fullWidthonly() {
            $(".c-hero-video").find("-fullwidthonly");
            console.log("-fullwidth class in the page!");
        }
        if ((fullWidthonly = true)) {
            $(".-fullwidthonly .video").addClass("container");
            console.log(".-fullwidthonly .container added!");
        }
        // JQUERY - if .-fullwidthonly then remove .container
        function fullWidthvideo() {
            $(".c-hero-video").find("-fullWidthvideo");
            console.log("-fullwidth class in the page!");
        }
        if ((fullWidthvideo = true)) {
            $(".-fullWidthvideo .video").removeClass("container");
            console.log(".-fullWidthvideo .container added!");
        }
    });
}
